import React from 'react';
import Navbar from './components/photoComponents/Navbar';
import './App.css';
// import Home from './components/pages/Home';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
// import Services from './components/pages/Services';
// import Products from './components/pages/Products';
// import SignUp from './components/pages/SignUp';
import PhotographyPage from './Photocomponents/Pages/PhotographyPage';
import WebDevPage from './WebDevComponents/Pages/WebDevPage';
import LandingPage from './WebDevComponents/Pages/LandingPage';

function App() {
  return (
    <>
      <Router>
        <Navbar />
        <Switch>
          <Route path='/' exact component={LandingPage} />
          <Route path='/PhotographyPage' component={PhotographyPage} />
          <Route path='/WebDevPage' component={WebDevPage} />
          {/* <Route path='/sign-up' component={SignUp} /> */}
        </Switch>
      </Router>
    </>
  );
}

export default App;
